const styles = import('./sessionsList.css')

const SessionItem = ({time, auditorium}) => {
  return(
    <button style={{display: "flex", flexDirection: "row"}}>
      <div>{time}</div>
      <div>{auditorium}</div>
    </button>
  )
}

export default SessionItem;
